import React from 'react';

function Grid({ robotPosition }) {
  // Define CSS styles for the grid cells, robot, and red square
  const cellStyle = {
    width: '50px',
    height: '50px',
    border: '1px solid black',
  };

  const robotStyle = {
    backgroundColor: 'green',
    width: '50px',
    height: '50px',
    position: 'absolute',
    top: `${robotPosition.y * 50}px`,
    left: `${robotPosition.x * 50}px`,
  };

  const endSquareStyle = {
    // backgroundColor: 'red',
    // width: '50px',
    // height: '50px',
    // position: 'absolute',
    // bottom: '0',
    // right: '0',
  };

  return (
    <div style={{ display: 'grid', gridTemplateColumns: 'repeat(5, 1fr)', gridGap: '2px' }}>
      {Array.from({ length: 25 }, (_, index) => (
        <div key={index} style={cellStyle}></div>
      ))}
      <div style={robotStyle}></div>
      <div style={endSquareStyle}></div>
    </div>
  );
}

export default Grid;
